내용:
나이키(NIKE) 사러 왔다 나이스(NICE)를 왜사는거야ㅋㅋ

한편, 오리엔탈정공이 왜 이 지사 테마주가 됐는지에 대해서는 아무도 알지 못 한다. 이 지사는 어린 시절 오리엔트정공 계열사인 성남의 오리엔트시계 공장에서 소년공으로 일한 것으로 알려졌다. 하지만 이날 정작 오리엔트정공은 1.51% 상승하는데 그쳤다.

얼른 안나오면 지옥을 경험하게 될꺼임;;

흥행을 치면 머하나....그냥 작품 잡채만 올리고, 기술주는 찬 밥인건가,..ㅠㅠ
하긴 낚인 내가 죄징....ㅠㅠ누굴 원망해..;
